import Axios from "axios";
class chairmanRegistration extends React.Component {
  state = {
    username: "",
    email: "",
    password: "",
    ConfrimPassword: "",
    department: "",
  };

  render() {
    return <Container></Container>;
  }
}

export default chairmanRegistration;
